      color: white;

      margin: 23px;

      float: left;
      margin: 4px;

    #footer {
      clear: both;

      float: left;
    }

    #top {

    }
    /* just for this page */
    #scroll-to-top {
      background-color: white;
      color: black;
      bottom: 0px;
    }

    /* for scrollUp plugin CSS */
    #scrollUp {
      bottom: 0px;
      right: 140px;
      padding: 10px 20px;
      background: #555;
      color: #fff;
    }

  <a href="#top">Kryogenix</a>
  <a href="#" id="tween-scroll">TweenLite</a>
  <a href="#" id="scroll-to">ScrollTo</a>

  <a id="scroll-to-top" href="#"><br/><br/>CSS3</a>
</div>

<script src="jquery.min.js" type="text/javascript"></script>
<script src="scroll-to-top.js" type="text/javascript"></script>
<script src="scroll-to-top-example.js" type="text/javascript"></script>

<script src="tween/tween_lite.js?body=1" type="text/javascript"></script>
<script src="tween/ScrollToPlugin.js?body=1" type="text/javascript"></script>
<script src="smoothscroll.js" type="text/javascript"></script>
<script src="scroll.to.js" type="text/javascript"></script>
<script src="scrollUp.js" type="text/javascript"></script>

<script>
  $(function () {


    // scroll-to-top
    $(window).scroll(
        function () {

          if ($(this).scrollTop() > 200) {
            $('#scroll-to-top').addClass('visible');
          } else {
            $('#scroll-to-top').removeClass('visible');
          }

        });

    // Get the click event
    $("#tween-scroll").on("click", function (e) {
      e.preventDefault();
      TweenLite.to($('body,html'), 1.0, {scrollTo: {y: 0, x: 0}, ease: Quint.easeOut});
    });

    // http://www.dconnell.co.uk/blog/index.php/2012/03/12/scroll-to-any-element-using-jquery/
    $('#scroll-to').on('click', function (e) {
      e.preventDefault();
      $.scrollTo($('body,html'));
    });

    $.scrollUp({scrollText: 'ScrollUp'});

    // load up the page
    var noop = function() {
      $('#random').html('' + Math.random() * 1000000 / 999999);
    };

    var load = $(location).attr('search').split('=');
    load = parseInt(load[1], 10) || 300;

    // never thought i'd write a for loop again
    for (var i = 0; i < load; i++) {
      setInterval(noop, 1);
    }

    // add links at the top to speed it up, slow it down.
    $('#top').prepend('<a href="#footer">To Bottom</a>');
    $('#top').prepend('<a class="load" href="demo.html?load=' + (load - 100) + '">Less load</a>');
    $('#top').prepend('<a class="load"href="demo.html?load=' + (load + 100) + '">More load</a>');

  });
</script>
</body>
</html>
